{
	jint ret;
	SDL_Event event;
	fprintf(stdout,"\nIn lejos_nxt_Button_getButtons!");
	ret=0;
	if (sdl_is_init>=1){
		if (SDL_PollEvent(&event)){
			switch(event.type){
				case SDL_KEYDOWN:
					switch(event.key.keysym.sym//scancode
							)
					{
						case SDLK_a:
						case SDLK_LEFT:
							ret=ID_LEFT;
							break;
						case SDLK_d:
						case SDLK_RIGHT:
							ret=ID_RIGHT;
							break;
						case SDLK_RETURN:
							ret=ID_ENTER;
							break;
						case SDLK_ESCAPE:
							ret=ID_ESCAPE;
							break;
						
					}
				break;
			}
		}
	}
	
	KNI_ReturnInt(ret);

}
