//JNIFunc={  int lejos/nxt/NXTEvent:: changeEvent (int set,int clear);}
//private native int changeEvent(int set, int clear)
KNI_RETURNTYPE_INT lejos_nxt_NXTEvent_changeEvent(void)
{
	jint ret;
	jint set;
	jint clear;
	KNI_StartHandles(1);
	KNI_DeclareHandle(this_ref);
	

	KNI_GetThisPointer(this_ref);
	set=KNI_GetParameterAsInt(1);
	clear=KNI_GetParameterAsInt(2);

	//fprintf(stdout,"\nIn lejos_nxt_NXTEvent_changeEvent!");
	NXTEvent*event=NXTEvent_REF2PTR(*this_ref);
	//dump_nxt_event(event);
	event->userEvents &= ~clear;
	event->userEvents |= set;
	// deliver event now if it matches the filter and someone is waiting
	set &= event->filter;
	if (set && event->sync->state == NXT_EVENT_WAITING //&& get_monitor_count(&(event->sync->_super.sync)) == 0
		)
	{
		printf("\nFix me!require schedule_request(REQUEST_SWITCH_THREAD)!");
		event->eventData |= set;
		event->sync->state |= SET;
		//monitor_notify_unchecked(&event->sync->_super, 1);
		//schedule_request(REQUEST_SWITCH_THREAD);
	}
	ret=event->userEvents;
	KNI_EndHandles();
	
	KNI_ReturnInt(ret);

}
